onga data Ken Thompson, o sistema operacional Unix.\n\n.\n\n#learnwebdevelopment #javascript #javascriptdeveloper #javascripttutorial #webdeveloping #php #http #nodejs #frontenddeveloper #backenddevelopment #fullstack #webserver #learntocode #hardware #design #ux #ui #frontend #backend #databases"}}]},"shortcode":"CfMNpaftMV_","edge_media_to_comment":{"count":36},"taken_at_timestamp":1656079729,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290027734_139739275383120_4940752348538367612_n.jpg?stp=dst-jpg_e15_fr_p1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=1TV5GaD2Wz4AX-EeALz\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9U88u4FYc-PDIr9ZKbX1ZS5d9EjxN9R4c7zstxcZsodw\u0026oe=62BC08A1\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3203},"edge_media_preview_like":{"count":3203},"owner":{"id":"5607584696"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290027734_139739275383120_4940752348538367612_n.jpg?stp=c0.135.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=1TV5GaD2Wz4AX-EeALz\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_pllXVVApWwVy9QUqItMGcMoPVYQWat4CqGUDRPDHatQ\u0026oe=62BC08A1\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290027734_139739275383120_4940752348538367612_n.jpg?stp=c0.135.1080.1080a_dst-jpg_e15_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=1TV5GaD2Wz4AX-EeALz\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-YkQ3UcOQifDYl-hUo_5MNsqhJ3LFp5p7GLLnrU1MaMw\u0026oe=62BC08A1\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290027734_139739275383120_4940752348538367612_n.jpg?stp=c0.135.1080.1080a_dst-jpg_e15_s240x240\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=1TV5GaD2Wz4AX-EeAL